import styled from "styled-components";

export const Container = styled.div`
    width: 100%;
    padding: 40px;
    border-radius: 32px;
    max-width: 1280px;
    margin-top: 20px;
    display: flex;
    flex-direction: column;
    align-items: center;
    gap: 10px;
    background-color: #FFF;
`;

export const Title = styled.h2`
    color: #195275;
    font-size: 32px;
    font-weight: 700;
`;

export const Row = styled.div`
    display: flex;
    align-items: center;
    gap: 16px;
    padding: 32px 0px;
`;
